import React from 'react';
import { Menu } from 'semantic-ui-react';
import { Link } from '../routes';


export default () => {
    return (
        <Menu style={{ marginTop: '50px ', marginLeft:'80px', marginRight:'80px'}}>

            <Link route="/">
                <a className="item">Halal Logistic System</a>
            </Link>

            <Menu.Menu position="right">
                <Link route="/form/cf">
                    <a className="item">Container</a>
                </Link>

                <Link routes="/form/warehouseForm">
                    <a className="item">Warehouse</a>
                </Link>

                <Link routes="/form/containerForm">
                    <a className="item">Product</a>
                </Link>

                <Link routes="/form/show">
                    <a className="item">Historical record</a>
                </Link>
            </Menu.Menu>          
        </Menu>
    );
};
